import React, { useState, useEffect } from 'react';
import axios from 'axios';

const HomePageBannerOne = () => {

    const [bannerData, setBannerData] = useState([]);
    const [bannerNumber, setBannerNumber] = useState(1);

    const fetchingBannerApi = async () => {
        let pageName = "Home Page";
        try {
            let response = await axios({
                method: "POST",
                url: `${process.env.React_App_Host_Url}/api/get/data/banner/by/page/name`,
                data: { pageName }
            });
            // console.log(response);
            if (response.status == 200) {
                setBannerData(response.data.data);
            }
        } catch (error) {
            console.log('Failed while fetching banner api by page name: ', error);
        }
    };

    useEffect(() => {
        fetchingBannerApi();
    }, []);

    return (
        <>
            {/* <div className='banner-container'>
                {bannerData.length > 0 ?
                    bannerData.map((item, index) => {
                        return (
                            <div style={{ width: '85%' }} key={index} dangerouslySetInnerHTML={{ __html: item.bannerNumber == bannerNumber ? item.bannerHTML : '' }}></div>
                        )
                    })
                    :
                    ''
                }
            </div> */}
            <div className='banner-container mt-5 mb-0'>
                <div style={{ width: '77%' }}>
                    <iframe
                        loading="lazy"
                        className="luxurysuper_first_deskt_2022-01-01_2022-12-31"
                        src="data:image/png;base64,"
                        style={{ width: "100%", height: 216 }}
                        scrolling="no"
                        frameBorder={0}
                        // allowTransparency="true"
                        allow="autoplay"
                        // allowFullScreen="true"
                    />
                </div>
            </div>
        </>
    );
};

export default HomePageBannerOne;